import React from 'react'
import alarm from '../../images/sunrise-alarm.svg'
import './TopBar.css'

const TopBar = () => {
    return (
        <nav className="header">
            <div className="nav-wrapper">
                <img src={alarm} alt="alarm"/>
            </div>
        </nav>
    )
}

export default TopBar;
